public void init()
{
    super();

    element.showClosed(false);

    element.updateDesign_Lines(InventDimFormDesignUpdate::Init);
}

public void showClosed(boolean _showClosed)
{
    if (_showClosed)
    {
        qbrOpen.value(SysQuery::valueUnlimited());
    }
    else
    {
        qbrOpen.value(SysQuery::value(NoYes::No));
    }

    whsMixedLPReceivingHeader_ds.executeQuery();
}

