/// </returns>
public InventDimCtrl_Frm_WHS inventDimSetupObject()
{
    return inventDimFormSetup;
}

public void allowEdit(boolean _allowEdit)
{
    LPComplete.enabled(_allowEdit);
    DeleteLineButton.enabled(_allowEdit);
    ChangeLPId.enabled(_allowEdit);
    WHSMixedLPReceivingLine_ds.allowEdit(_allowEdit);
}

public void updateDesign_Lines(InventDimFormDesignUpdate _mode)
{
    InventDimParm inventDimParmLocal;
    InventDimParm inventDimParmLock;

    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init:
        if (!inventDimFormSetup)
            {
                inventDimFormSetup = InventDimCtrl_Frm_WHS::newFromForm(element);

                // Lock these fields off
                inventDimParmLock.setActiveSiteAndWarehouseDimensions();
                inventDimParmLock.WMSLocationIdFlag    = NoYes::Yes;
                inventDimParmLock.LicensePlateFlag     = NoYes::Yes;
                inventDimFormSetup.parmDimParmLockedRightClick(inventDimParmLock);

                inventDimParmLocal.setAllProductDimensions();
                inventDimParmLocal.setAllTrackingDimensions();
                inventDimFormSetup.parmDimParmVisibleGrid(inventDimParmLocal);
            }

        case InventDimFormDesignUpdate::Active:
            inventDimFormSetup.formActiveSetup();
            inventDimFormSetup.formSetControls(true);
            break;

        default:
            throw error(strFmt("@SYS54195", funcName()));
    }
}

protected ItemId getItemIdFromDatasources()
{
    switch (WHSMixedLPReceivingLine.InventTransType)
    {
        case InventTransType::Purch:
            return PurchLine.ItemId;

        case InventTransType::Sales:
            if (isReturnOrderCreationFromMobileDeviceEnabled)
            {
                return WHSMixedLicensePlateReceiptLineReturnOrderUnion.ItemId;
            }
            else
            {
                return SalesLine.ItemId;
            }

        case InventTransType::TransferOrderShip:
            return InventTransferLine.ItemId;

        default:
            if (!WHSWorkExecuteDisplayReceivingRefactoringFlight::instance().isEnabled())
            {
                throw Error(Error::wrongUseOfFunction(funcName()));
            }
            return '';
    }
}

protected boolean isWorkTransTypeMatching(WHSWorkTransType _workTransType)
{
    return WHSMixedLPReceivingHeader.WorkTransType == _workTransType;
}

[Wrappable(true)]
internal WHSReceiptOrderLine getReceiptOrderLine()
{
    return PurchLine;
}

public void updateCatchWeightControls()
{
    boolean shouldEnableCapturedWeightControl = PdsGlobal::pdsIsCWItem(this.getItemIdFromDatasources());

    if (WHSMixedLPReceivingHeader.WorkTransType == WHSWorkTransType::TransferReceipt
        && WHSMixedLPReceivingHeader.ReceiptStatus == WHSMixedLicensePlateReceiptStatus::Processing)
    {
        shouldEnableCapturedWeightControl = false;
    }

    enableDSField(WHSMixedLPReceivingLine_ds, fieldNum(WHSMixedLicensePlateReceiptLine, CapturedWeight), shouldEnableCapturedWeightControl);
}

private void enableDisableProcessingErrorsButton()
{
    ProcessingErrors.enabled(WHSMixedLicensePlateReceiptLog.Info != conNull());
}

private boolean showDispositionDialog(WHSRFMenuItemTable _rfMenuItem)
{
    switch (_rfMenuItem.WorkCreationProcess)
    {
        case WHSWorkCreationProcess::ReturnItemReceiving:
            return !_rfMenuItem.ShowDisposition; // If the disposition code is captured during the mobile device flow, then don't ask for it again.
        default:
            // Other mixed license plate receiving flows never show the disposition code during the flow itself, so it needs to be captured here.
            // Return order receiving doesn't have a setting to show the disposition code, so it must always be captured here.
            return _rfMenuItem.ShowDisposition
                || (_rfMenuItem.MixedLPReceivingMode == WHSMixedLPReceivingMode::ReturnOrderReceiving
                    && WHSMixedLPReceivingLPCompleteReturnOrderReceivingShowDispositionDialogFlight::instance().isEnabled());
    }
}

public int active()
{
    int ret = super();

    if (WHSMixedLPReceivingHeader.CurrentUser
    ||  WHSMixedLPReceivingHeader.MixedLPComplete == NoYes::Yes)
    {
        element.allowEdit(false);
    }
    else
    {
        element.allowEdit(true);
    }

    this.updateDesignBasedOnHeaderData(WHSMixedLPReceivingHeader);

    return ret;
}

[Wrappable(true)]
internal void updateDesignBasedOnHeaderData(WHSMixedLicensePlateReceipt _mixedLpReceipt)
{
    this.updateMixedLPLineDisplay(_mixedLpReceipt.WorkTransType);

    if (WHSMixedLPReceivingPlannedLinesTabRefactoringFlight::instance().isEnabled())
    {
        this.updatePlannedMixedLPLineDisplay(_mixedLpReceipt.SourceOrderStatus); 
    }
    else 
    {
        QueryBuildDataSource plannedLinesDs = WHSMixedLicensePlateReceiptLineForPlanned_ds.queryBuildDataSource();
        plannedLinesDs.enabled(false);
    }
}

internal void updatePlannedMixedLPLineDisplay(WHSMixedLPSourceOrderStatus _OrderStatus)
{
    QueryBuildDataSource plannedLinesDs = WHSMixedLicensePlateReceiptLineForPlanned_ds.queryBuildDataSource();
    plannedLinesDs.enabled(_orderStatus == WHSMixedLPSourceOrderStatus::Planned);

    PlannedLinesTabPage.visible(_orderStatus == WHSMixedLPSourceOrderStatus::Planned);
    LinesTabPage.visible(_orderStatus != WHSMixedLPSourceOrderStatus::Planned);
}

		protected void updateMixedLPLineDisplay(WHSWorkTransType _workTransType)
        {
            if (WHSWorkExecuteDisplayReceivingRefactoringFlight::instance().isEnabled())
            {
                PurchGroup.visible(_workTransType == WHSWorkTransType::Purch);
                PurchLine_ds.queryBuildDataSource().enabled(_workTransType == WHSWorkTransType::Purch);

                InventTransferGroup.visible(_workTransType == WHSWorkTransType::TransferReceipt);
                InventTransferLine_ds.queryBuildDataSource().enabled(_workTransType == WHSWorkTransType::TransferReceipt);

                if (isReturnOrderCreationFromMobileDeviceEnabled)
                {
                    ReturnLineGroup.visible(false);
                    SalesLine_ds.queryBuildDataSource().enabled(false);
                    ReturnPlannedLineGroup.visible(_workTransType == WHSWorkTransType::ReturnOrder);
                    QueryBuildDataSource unionDS = WHSMixedLicensePlateReceiptLineReturnOrderUnion_ds.queryBuildDataSource();
                    unionDS.enabled(_workTransType == WHSWorkTransType::ReturnOrder);
                    unionDS.addLink(fieldNum(WHSMixedLicensePlateReceipt, RecId), fieldNum(WHSMixedLicensePlateReceiptLineReturnOrderUnion, MixedLPReceiptLine));
                }
                else
                {
                    ReturnLineGroup.visible(_workTransType == WHSWorkTransType::ReturnOrder);
                    SalesLine_ds.queryBuildDataSource().enabled(_workTransType == WHSWorkTransType::ReturnOrder);
                    ReturnPlannedLineGroup.visible(false);
                    WHSMixedLicensePlateReceiptLineReturnOrderUnion_ds.queryBuildDataSource().enabled(false);
                }
            }
            else
            {
                switch (_workTransType)
                {
                    case WHSWorkTransType::Purch:
                        PurchGroup.visible(true);
                        InventTransferGroup.visible(false);
                        ReturnLineGroup.visible(false);
                        PurchLine_ds.queryBuildDataSource().enabled(true);
                        InventTransferLine_ds.queryBuildDataSource().enabled(false);
                        SalesLine_ds.queryBuildDataSource().enabled(false);
                        break;
                    case WHSWorkTransType::TransferReceipt:
                        PurchGroup.visible(false);
                        InventTransferGroup.visible(true);
                        ReturnLineGroup.visible(false);
                        PurchLine_ds.queryBuildDataSource().enabled(false);
                        InventTransferLine_ds.queryBuildDataSource().enabled(true);
                        SalesLine_ds.queryBuildDataSource().enabled(false);
                        break;
                    case WHSWorkTransType::ReturnOrder:
                        PurchGroup.visible(false);
                        InventTransferGroup.visible(false);
                        PurchLine_ds.queryBuildDataSource().enabled(false);
                        InventTransferLine_ds.queryBuildDataSource().enabled(false);
                        if (isReturnOrderCreationFromMobileDeviceEnabled)
                        {
                            ReturnLineGroup.visible(false);
                            SalesLine_ds.queryBuildDataSource().enabled(false);
                            ReturnPlannedLineGroup.visible(true);
                            QueryBuildDataSource unionDS = WHSMixedLicensePlateReceiptLineReturnOrderUnion_ds.queryBuildDataSource();
                            unionDS.enabled(true);
                            unionDS.addLink(fieldNum(WHSMixedLicensePlateReceipt, RecId), fieldNum(WHSMixedLicensePlateReceiptLineReturnOrderUnion, MixedLPReceiptLine));
                        }
                        else
                        {
                            ReturnLineGroup.visible(true);
                            SalesLine_ds.queryBuildDataSource().enabled(true);
                            ReturnPlannedLineGroup.visible(false);
                            WHSMixedLicensePlateReceiptLineReturnOrderUnion_ds.queryBuildDataSource().enabled(false);
                        }
                        break;
                }
            }
        }

