public boolean validateWrite()
{
    boolean ret;

    ret = super();

    ItemId itemId = element.getItemIdFromDatasources();
    boolean isCWItem = PdsGlobal::pdsIsCWItem(itemId);

    if (ret && isCWItem && !PDSCatchWeight::validateInventQty(itemId, WHSMixedLPReceivingLine.CapturedWeight, WHSMixedLPReceivingLine.InventQty, false))
    {
        ret = checkFailed(strFmt("@WAX:Error_InvalidCatchWeight", WHSMixedLPReceivingLine.CapturedWeight, WHSMixedLPReceivingLine.InventQty, itemId));
    }

    if (ret
    &&  whsMixedLPReceivingLine.InventQty > whsMixedLPReceivingLine.orig().InventQty
    &&  (element.isWorkTransTypeMatching(WHSWorkTransType::Purch)
        || WhsWorkTransactionType::singletonFromTypeOrDefault(WHSMixedLPReceivingHeader.WorkTransType).isForExternalInboundShipment()))
    {
        WHSReceiptOrderLine orderLine = element.getReceiptOrderLine();
        // Gets the total quantity for the trans id and then adds the difference that was added on the form.
        Qty qty = WHSMixedLicensePlateReceiptLine::getTotalOpenQtyOnTransId(orderLine.InventTransId) + (WHSMixedLPReceivingLine.InventQty - WHSMixedLPReceivingLine.orig().InventQty);

        real pct;

        if (isCWItem)
        {
            pct = (((orderLine.pdsCWRegistered() + orderLine.pdsCWReceivedInTotal() + qty) / orderLine.PdsCWQty) * 100) - 100;
        }
        else
        {
            ProductQuantity receivedInTotal
                = WHSWorkExecuteDisplayReceivingRefactoringFlight::instance().isEnabled()
                ? orderLine.receivedInventInTotal()
                : orderLine.receivedInTotal();
            pct = (((orderLine.registered() + receivedInTotal + qty) / orderLine.InventQty) * 100) - 100;
        }

        if (pct > orderLine.OverDeliveryPct)
        {
            ret = checkFailed("@WAX2142");
        }
    }

    return ret;
}

