        public void clicked()
        {
            // Possible an rf user rescanned into this license plate.
            whsMixedLPReceivingHeader.reread();

            if (!whsMixedLPReceivingHeader.CurrentUser)
            {
                WHSUserId userId = WHSParameters::find().GenericWorkUserId;

                WHSRFMenuItemTable rfMenuItem = WHSRFMenuItemTable::find(whsMixedLPReceivingHeader.MenuItemName);
                boolean showDispositionDialog = element.showDispositionDialog(rfMenuItem);
                boolean isDispositionCodeCaptured;
                WHSDispositionCode dispositionCodeValue;

                if (showDispositionDialog)
                {
                    WHSMixedLPCompleteDispositionCodeDialog dialog = WHSMixedLPCompleteDispositionCodeDialog::construct();
                    [isDispositionCodeCaptured, dispositionCodeValue] = dialog.captureDispositionCode(whsMixedLPReceivingHeader);
                }

                if (!showDispositionDialog || isDispositionCodeCaptured)
                {
                    WHSMixedLicensePlateCompleter mixedLicensePlateCompleter = WHSMixedLicensePlateCompleter::newFromLicensePlateIdAndUser(whsMixedLPReceivingHeader.LicensePlateId, userId);
                    if (showDispositionDialog)
                    {

						mixedLicensePlateCompleter.parmDispositionCode(dispositionCodeValue);

                    }
                    WHSWorkBuildId workBuildId = mixedLicensePlateCompleter.completeMixedLicensePlate();

                }
            }

            super();

            WHSMixedLPReceivingHeader_ds.research();
        }

public void clicked()
{
    // Possible an rf user rescanned into this license plate.
    whsMixedLPReceivingHeader.reread();

    if (!whsMixedLPReceivingHeader.CurrentUser)
    {
        Dialog dialog = new Dialog("@WAX2202");
        dialog.windowType(FormWindowType::PopUp);

        // Adding the current value in each field allows the User to only change the field they want to change
        DialogField dialogField = dialog.addFieldValue(extendedTypeStr(WHSLicensePlateId), whsMixedLPReceivingHeader.LicensePlateId);
        DialogField containerField = dialog.addFieldValue(extendedTypeStr(WHSContainerTypeCode), whsMixedLPReceivingHeader.ContainerTypeCode);

        if (!whsMixedLPReceivingHeader.ContainerTypeCode)
        {
            containerField.visible(false);
        }

        dialog.run();

        if (dialog.closedOk())
        {
            WHSLicensePlateId newLPId = dialogField.value();
            WHSContainerTypeCode containerCode = containerField.value();

            if (whsMixedLPReceivingHeader.LicensePlateId    != newLPId
            ||  whsMixedLPReceivingHeader.ContainerTypeCode != containerCode)
            {
                WHSLicensePlate::createLicensePlate(newLPId, false, containerCode);

                InventDim   inventDim;
                inventDim.LicensePlateId = newLPId;
                inventDim = InventDim::findOrCreate(inventDim);

                InventOnHandQty onHandQty = InventOnHandQty::newParameters('', inventDim);
                onHandQty.parmInventDimParm(inventDim.toDimParm());

                if (onHandQty.picked() == 0
                &&  onHandQty.physicalInvent() == 0)
                {
                    ttsBegin;

                    whsMixedLPReceivingHeader.LicensePlateId    = newLPId;
                    whsMixedLPReceivingHeader.ContainerTypeCode = containerCode;
                    whsMixedLPReceivingHeader.update();

                    WHSMixedLicensePlateReceiptLine mixedLPLines;

                    while select forUpdate mixedLPLines
                        where mixedLPLines.MixedLPReceivingTable == whsMixedLPReceivingHeader.RecId
                    {
                        InventDim lineInventDim = InventDim::find(mixedLPLines.InventDimId);
                        lineInventDim.LicensePlateId = newLPId;
                        lineInventDim = InventDim::findOrCreate(lineInventDim);

                        mixedLPLines.InventDimId = lineInventDim.inventDimId;
                        mixedLPLines.update();
                    }

                    ttsCommit;
                }
                else
                {
                    error(strFmt("@WAX:Error_LicensePlateIsNotEmpty", newLPId));
                }
            }
        }
    }

    super();

    WHSMixedLPReceivingHeader_ds.refresh();
    WHSMixedLPReceivingLine_ds.research();
}

public void clicked()
{
    if (WHSMixedLicensePlateReceiptLog.Info == conNull())
    {
        return;
    }

    SysInfologEnumerator logEnumerator = SysInfologEnumerator::newData(WHSMixedLicensePlateReceiptLog.Info);
    while (logEnumerator.moveNext())
    {
        SysInfoAction infoAction;
        DictClass dictClass = new DictClass(logEnumerator.currentActionClassId());
        if (dictClass)
        {
            infoAction = dictClass.makeObject();
            if (infoAction)
            {
                infoAction.unpack(logEnumerator.currentActionClassData());
            }
        }

        infolog.add(
            logEnumerator.currentException(),
            logEnumerator.currentMessage(),
            logEnumerator.currentHelpUrl(),
            infoAction ? infoAction : null);
    }
}

